import { createSlice } from '@reduxjs/toolkit'

export const buyFB = createSlice({
    name: 'buyFasionBox',
    initialState: {
        boxCount: 0,
        totalPrice: 0
    },
    reducers: {
        buyFasionBox: (state) => {
            state.boxCount += 10
            state.totalPrice += 270
        }
    },
})

// Action creators are generated for each case reducer function
export const { buyFasionBox } = buyFB.actions
export default buyFB.reducer
